import { Col, Container, Row } from 'reactstrap';

const register = () => {
  return (
    <Container>
      <Row>
        <Col>
          <div className="paper">
            <div className="header">
              <h2>ユーザー登録</h2>
            </div>
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default register;
